sys_variable_value.value:
(function execute(inputs, outputs) {
try {
 var r = new sn_ws.RESTMessageV2('x_956379_openshi_0.AAP Destroy Cluster', 'Destroy Cluster');
 r.setStringParameterNoEscape('openshift_record_id', inputs.openshift_record_id);
 r.setStringParameterNoEscape('cluster_platform', inputs.cluster_platform);
 r.setStringParameterNoEscape('cluster_name', inputs.cluster_name);
 r.setStringParameterNoEscape('protected', inputs.protected);
 var response = r.execute();
 var responseBody = response.getBody();
 var httpStatus = response.getStatusCode();
 outputs.status_code = httpStatus;
 outputs.message = responseBody;
}
catch(ex) {
 var message = ex.message;
 outputs.message = message;
 outputs.status_code = 500;
}
})(inputs, outputs);

